import base64
import io
import wx

ICONS = {
    name: base64.b64decode(data) for name, data in {
        "emulator-power": "",
        "emulator-volume-up": "",
        "emulator-volume-down": "",
        "emulator-screenshot": "",
        "emulator-rotate-left": "",
        "emulator-rotate-right": "",
        "emulator-back": "",
        "emulator-home": "",
        "emulator-apps": "",
        "emulator-more": "",
    }.items()
}


def get_icon(name):
    data = io.BytesIO(ICONS[name])
    return wx.Image(data).ConvertToBitmap()
